script: |
  super -f text -I q3203.spq | sort > q3203.out

inputs:
  - name: q3203.spq
    data: |
      SELECT DISTINCT - col1 - col2 AS col1 FROM tab1 (FORMAT parquet) WHERE - col2 NOT IN ( 17 + + col2 / + col0 * + + col2 );
  - name: tab1

outputs:
  - name: q3203.out
    data: |
      -110
      -115
      -64
